import { faker } from '@faker-js/faker';
import { add, compareDesc } from 'date-fns';
import {
  DirectionTypes,
  DispositionTypes,
  ICallHistoryRecord,
  ISpeedDialRecord,
  IWebexIntContact,
  IWebexVoicemail,
} from '@webex-int/adapter-interfaces';
import { ISpeedDialItem } from '../components/SpeedDials/SpeedDials.types';

/**
 * Helper to simulate network requests.
 *
 * @param {number} min Min number
 * @param {number} max Max number
 * @returns {number} A random number
 */
export function randomIntFromInterval(min: number, max: number): number {
  return Math.floor(Math.random() * (max - min + 1) + min);
}

/**
 *
 */
export function createMSUser() {
  const givenName = faker.name.firstName();
  const surname = faker.name.lastName();
  return {
    id: faker.datatype.uuid() as string,
    displayName: `${givenName} ${surname}`,
    givenName,
    surname,
    mail: faker.internet.email(),
    mobilePhone: faker.phone.number('1-###-###-####'),
    businessPhones: [
      faker.phone.number('1-###-###-####'),
      faker.phone.number('1-###-###-####'),
    ],
    photo: faker.image.avatar(),
    type: faker.datatype.boolean() ? 'directory' : 'outlook',
  };
}

export const createSpeedDialItem = (user?: ISpeedDialRecord) => {
  let u = user;
  if (!user) {
    u = createMSUser();
  }
  return {
    isAudio: faker.datatype.boolean(),
    status: faker.datatype.boolean() ? 'Work' : 'Home',
    ...u,
    currentCallAddress: u?.mobilePhone,
  };
};

/**
 *
 * @param count
 */
export function createSpeedDialItems(count = 10): ISpeedDialItem[] {
  const out = [];

  // eslint-disable-next-line no-plusplus
  for (let i = 0; i < count; i++) {
    const user = createMSUser();
    out.push(createSpeedDialItem(user));
  }
  return out as ISpeedDialItem[];
}

/**
 *
 * @param root0
 * @param root0.count
 * @param root0.date
 */
export function createCallHistoryItems({
  count = 10,
  date = new Date(),
}): ICallHistoryRecord[] {
  return new Array(count)
    .fill({})
    .map(() => {
      const bool = faker.datatype.boolean();
      const startTime = faker.date.recent(4, date);
      return {
        id: faker.datatype.uuid(),
        name: faker.name.findName(),
        phoneNumber: faker.phone.number('+1-###-###-####'),
        startTime: startTime.toISOString(),
        endTime: add(startTime, {
          minutes: faker.datatype.number({ min: 1, max: 20 }),
          seconds: faker.datatype.number({ min: 1, max: 60 }),
        }).toISOString(),
        direction: bool ? DirectionTypes.INCOMING : DirectionTypes.OUTGOING,
        disposition: bool
          ? DispositionTypes.MISSED
          : DispositionTypes.CANCELLED,
      };
    })
    .sort((a, b) => {
      return compareDesc(new Date(a.startTime), new Date(b.startTime));
    });
}

/**
 * @param count.count
 * @param count
 * @param minPhone
 * @param count.minPhone
 * @param count.maxPhoneNumbers
 * @param count.minEmail
 * @param count.maxEmail
 * @param count.minPhoneNumbers
 * @param count.minEmailAddresses
 * @param count.maxEmailAddresses
 * @description Create mock webex int contact
 */
export function createWebexIntUser({
  minPhoneNumbers = 0,
  maxPhoneNumbers = 5,
  minEmailAddresses = 0,
  maxEmailAddresses = 5,
}): IWebexIntContact {
  return {
    id: faker.datatype.uuid(),
    name: faker.name.findName(),
    phoneNumbers: new Array(
      faker.datatype.number({ min: minPhoneNumbers, max: maxPhoneNumbers })
    )
      .fill({})
      .map(() => ({
        address: faker.phone.number('+1-###-###-####'),
        type: faker.word.noun(),
      })),
    emailAddresses: new Array(
      faker.datatype.number({ min: minEmailAddresses, max: maxEmailAddresses })
    )
      .fill({})
      .map(() => ({
        address: faker.internet.email(),
        type: faker.word.noun(),
      })),
  };
}

/**
 *
 * @param root0
 * @param root0.count
 * @param root0.minPhoneNumbers
 * @param root0.maxPhoneNumbers
 * @param root0.minEmailAddresses
 * @param root0.maxEmailAddresses
 */
export function createWebexIntUsers({
  count = 10,
  minPhoneNumbers = 0,
  maxPhoneNumbers = 5,
  minEmailAddresses = 0,
  maxEmailAddresses = 5,
}): IWebexIntContact[] {
  return new Array(count).fill({}).map(() =>
    createWebexIntUser({
      minPhoneNumbers,
      maxPhoneNumbers,
      minEmailAddresses,
      maxEmailAddresses,
    })
  );
}

/**
 *
 * @param root0
 * @param root0.count
 * @param root0.date
 */
export function createVoicemailItems({
  count = 10,
  date = new Date(),
}): IWebexVoicemail[] {
  return new Array(count)
    .fill({})
    .map(() => ({
      id: faker.datatype.uuid(),
      name: faker.name.findName(),
      address: faker.phone.number('+1-###-###-####'),
      date: faker.date.recent(4, date).toISOString(),
      unread: faker.datatype.boolean(),
      duration: faker.seed(1644),
      audioSrc:
        'data:audio/wav;base64,' +
        '',
    }))
    .sort((a, b) => {
      return compareDesc(new Date(a.date), new Date(b.date));
    });
}

/**
 *
 * @param count
 */
export function createMSUsers(count = 25) {
  return new Array(count).fill({}).map(() => {
    return createMSUser();
  });
}

